import './App.css';
import Input from './componentes/Input';
import Selector from './componentes/Selector';
import Button from './componentes/Button';
import { useRef, useState } from 'react';

function App() {
  //Se crean las referencias y variables para tension
  const triphasic = useRef();
  const monophasic = useRef();
  //-----
  let btnTension;

  //Acciones para tensiones
  const changeStyleMono = (e) =>{
  btnTension === 'monophasic' ? btnTension = undefined : btnTension = 'monophasic';
  e.target.classList.toggle('btn--active');
  triphasic.current.classList.remove('btn--active');
 }

 const changeStyleTri = (e) =>{
  btnTension === 'triphasic' ? btnTension = undefined : btnTension = 'triphasic';
  e.target.classList.toggle('btn--active');
  monophasic.current.classList.remove('btn--active');
 }

 //Se crean referencias y variables para cableados
 const buried = useRef();
 const exterior = useRef();
 const air = useRef();
 //-----
 let btnConduit;

 //Acciones para cableados

 const changeStyle = (e, otro, otro2) =>{
  btnConduit === 'buried' ? btnConduit = undefined : btnConduit = 'buried';
  e.target.classList.toggle('btn--active');
  otro.current.classList.remove('btn--active');
  otro2.current.classList.remove('btn--active');
 }

 /*const changeStyleBur = (e) =>{
  btnConduit === 'buried' ? btnConduit = undefined : btnConduit = 'buried';
  e.target.classList.toggle('btn--active');
  exterior.current.classList.remove('btn--active');
  air.current.classList.remove('btn--active');
 }

 const changeStyleExt = (e) =>{
  btnConduit === 'exterior' ? btnConduit = undefined : btnConduit = 'exterior';
  e.target.classList.toggle('btn--active');
  buried.current.classList.remove('btn--active');
  air.current.classList.remove('btn--active');
 }

 const changeStyleAir = (e) =>{
  btnConduit === 'air' ? btnConduit = undefined : btnConduit = 'air';
  e.target.classList.toggle('btn--active');
  exterior.current.classList.remove('btn--active');
  buried.current.classList.remove('btn--active');
 }*/

 //Se crean referencias y variables para entradas
 const ratedPower = useRef();
 const fcValue = useRef();
 const fsValue = useRef();
 const performance = useRef();
 const fiCos = useRef();
 const segmentLength = useRef();
 const maxTensionFall = useRef();
 const ztValue = useRef();
 const kValue = useRef();
 //-----
 const [FC, setFC] = useState();
 const [RP, setRP] = useState();
 const [FS, setFS] = useState();
 const [Per, setPer] = useState();
 const [FiC, setFiC] = useState();
 const [SL, setSL] = useState();
 const [MTF, setMTF] = useState();
 const [ZtV, setZtV] = useState();
 const [KV, setKV] = useState();

 //Acciones para entradas
 /*const applyValue = (e, modifier) => {
  let value;
  modifier({value});
 }*/

 //Se crean referencias botones
 const btnCalc = useRef();

 //Acciones para botones
 const submit = (e) => {
  if(btnTension==='monophasic'){
    monophasicTension();
  }
  else if(btnTension==='triphasic'){
    triphasicTension();
  }
  else{
    error();
  }
 } 

 //Calculo para tensión trifásica
 const monophasicTension = () =>{
  alert('2');
 }


 //Calculo para tensión monofásica
 const triphasicTension = () =>{
  alert('3');
 }


 //Respuesta para ninguna opción
 const error = () =>{
  alert('4');
 }


 //Renderizado
  return (
    <div className="App">
      <div className='data-input-container'>
      <h1 className='tension-title'>Seleccionar tipo de electrificación</h1>
        <div className='tension-selector-container'>
          <Selector ref={monophasic} action={changeStyleMono} id={'tension monophasic '}>Monofásico</Selector>
          <Selector ref={triphasic} action={changeStyleTri} id={'tension triphasic'}>Trifásico</Selector>
        </div>
        <Input ref={ratedPower} /*change={applyValue({setRP})}*/ >Potencia nominal</Input>
        <Input ref={fcValue} /*change={applyValue({setFC})}*/ >Valor Fc</Input>
        <Input ref={fsValue} /*change={applyValue({setFS})}*/ >Valor Fs</Input>
        <Input ref={performance} /*change={applyValue({setPer})}*/ >Rendimiento</Input>
        <Input ref={fiCos} /*change={applyValue({setFiC})}*/ >Coseno de fí</Input>
        <h1 className='conduit-title'>Seleccionar tipo de Cañería</h1>
        <div className='conduit-selector-container'>
          <Selector ref={buried} action={changeStyle(exterior, air)} id={'conduit buried'}>Enterrado</Selector>
          <Selector ref={exterior} action={changeStyle(buried, air)} id={'conduit exterior'}>Exterior</Selector>
          <Selector ref={air} action={changeStyle(buried, exterior)} id={'conduit air'}>Aire</Selector>
        </div>
        <Input ref={segmentLength} /*change={applyValue({setSL})}*/ >Longitud del segmento en metros</Input>
        <Input ref={maxTensionFall} /*change={applyValue({setMTF})}*/ >Máximo porcentaje de caída</Input>
        <Input ref={ztValue} /*change={applyValue({setZtV})}*/ >Valor Zt</Input>
        <Input ref={kValue} /*change={applyValue({setKV})}*/ >Valor K</Input>
        <div className='button-container'>
          <Button ref={btnCalc} identifier={'submit'} action={submit}>Calcular</Button>
          <Button identifier={'clear'}>Limpiar</Button>
        </div>
      </div>
    </div>
  );
}

export default App;


